description:
The &quot;Meet The Beatles&quot; Compact 33 EP was released by Capitol Records in January 1964 for use in juke boxes only. 

The cover was the same as the &quot;Meet The Beatles&quot; LP, but the back was plain white. Each side contained 3 songs. 

1. &quot;It Won't Be Long&quot;
2. &quot;This Boy&quot;
3. &quot;All My Loving&quot;
4. &quot;Don't Bother Me&quot;
5. &quot;All I've Gotta Do&quot;
6. &quot;I Want To Be Your Man.&quot;
